import { Component } from "react";
import axios from "axios";

export default class ListOfUsers extends Component {
  constructor() {
    super();
    this.state = {};
  }
  componentDidMount = () => {
    axios.get("http://localhost:4000/allSiteUsers").then((RESULT) => {
      console.log(RESULT);
    });
  };
  render() {
    return <h1>List Of Users</h1>;
  }
}
